function Find() {
  var temp =document.getElementById("temp").value;
  var hum =document.getElementById("hum").value;
  var soil =document.getElementById("soil").value;
  var rain =document.getElementById("rain").value;
  var co=0;
 
  var jsondata =data;
  if(temp.length!=0 && hum.length!=0 && soil.length!=0 && rain.length!=0 && soil!="default")
  {
  for(var i=0;i<jsondata.length;i++){
      if(parseInt(jsondata[i].temperature)==parseInt( temp) && parseInt(jsondata[i].humidity)==parseInt( hum) && parseInt(jsondata[i].rainfall)==parseInt( rain) && jsondata[i].soil==soil)
      {
          console.log(jsondata[i].plant);
          co=co+1;
          document.getElementById("display").innerHTML=jsondata[i].plant;
      }
  }
  if(co==0){ 
    document.getElementById("display").innerHTML="No Plant Found";
   }
  }
  else{
    alert("Please Fill All Fields");
  }
  
  
}

